import axios from "axios";

const api = axios.create({
  baseURL: "https://api.coinpaprika.com/v1/"
});

export const API = {
  homePage: () => api.get("tickers"),
  exchange: () => api.get("exchanges"),
  coins: () => api.get("coins")
};
